import React from 'react';
import './src/App.css';
//import styled from "styled-components";
function Home(props) {
    return (
        <div>
        <nav>
          <div class="menu">
            <div class="logo">
              <a href="/">CodingLab</a>
            </div>
            <ul>
              <li><a href="/">Home</a></li>
              <li><a href="/blogs">Blogs</a></li>
            <li><a href="/contact">Contact</a></li>
            </ul>
          </div>
        </nav>
        <div class="img"></div>
        </div>
     );
}


export default Home;
